import numpy as numpy
import pandas as pd

def col_name_decode(col_list, table_name = ''):
    for n,c in enumerate(col_list):
        c_split = (table_name+'_'+c).upper().split('_')
        c_split = list(set(c_split))
        col_list[n] = '_'.join(sorted(c_split))
    return col_list

